import { useState } from "react";

export default function News(){
    var [news,setNews]=useState([])
    var [link,setLink]=useState("https://newsdata.io/api/1/latest?apikey=pub_48205f4fe927256206346a5098a9186e4b689&q=instagram&language=en")
    axios.get(`${link}`)
    .then((res)=>{
        setNews(res.data.results)
    })
    return(
    <>
    <h3>News Component</h3>
    {news.map((x)=><h4>{news.language}</h4>)}
    </>);
}
